import React from 'react';
import {Route} from 'react-router-dom';

import './App.css';

import HomePage from './pages/homepage/homepage.component'

const HatsPage = () => (
  <div>HATS PAGE!</div>
);

function App() {
  return <div>
    <Switch>
        <Route path='/' element={<HomePage />}/>
        <Route path='/hats' element={<HatsPage/>}/>
    </Switch>
  </div>;
}

export default App;
